import React from "react"

class MyApp extends React.Component{

    constructor(){
        super()
        this.state={
            name: "Dejan",
            age: 21
        }
    }

    render() {
       return(
            <div>
                <h1>{this.state.name}</h1>
                <h1>{this.state.age}</h1>
            </div>
        )
    }
}

export default MyApp
